import React from 'react';
import {View, Text, StyleSheet, TouchableOpacity} from 'react-native';

export default function Home() {
    return(
        <View>
            <Text>
                Luciano
            </Text>

            <View>
                <TouchableOpacity>
                    <Text>Cosultar Cep</Text>
                </TouchableOpacity>

                <TouchableOpacity>
                    <Text>
                        Buscar Rastreio
                    </Text>
                </TouchableOpacity>
            </View>
        </View>
    )
};

const styles = StyleSheet.create({
    content: {

    },

})
